import React from "react";
import { getProjects } from "../services/projects";

class ProjectList extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      projects: [],
      isReady: false,
    };
  }
  async componentDidMount() {
    const response = await getProjects();
    this.setState({ projects: response });
  }
  render() {
    const { isReady, projects} = this.state
    return (
      <table class="table table-hover">
        <thead>
          <tr>
            <th scope="col">Id</th>
            <th scope="col">Nombre</th>
            <th scope="col">LÃ­der</th>
            <th scope="col">Fecha de inicio planeada</th>
            <th scope="col">Fecha de fin planeada</th>
            <th scope="col">Fecha de inicio real</th>
            <th scope="col">Fecha de fin real</th>
            <th scope="col">Prioridad</th>
            <th scope="col">Estado</th>
            <th scope="col">Detalles</th>

          </tr>
        </thead>
        <tbody>
          {projects.map((project) => (
            <tr>
              <th scope="row">{project.id}</th>
              <td>{project.name}</td>
              <td>{project.leader_id}</td>              
              <td>{project.planned_start_date}</td>
              <td>{project.planned_end_date}</td>
              <td>{project.real_start_date}</td>
              <td>{project.real_end_date}</td>
              <td>{project.priority}</td>
              <td>{project.status}</td>
              <td><button type="button" class="btn btn-info">Info</button></td>
            </tr>
          ))}
        </tbody>
      </table>
    );
  }
}

export default ProjectList;
